import React from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';

const mapStyles = {
  width: '100%',
  height: '100%'
};

 const MapContainer = () => {return (
      <Map
        google={this.props.google}
        zoom={14}
        style={mapStyles}
        initialCenter={
          {
            lat: -1.2884,
            lng: 36.8233
          }
        }
      />
    );
  }


export default GoogleApiWrapper({
  apiKey: 'AIzaSyB0-fH77nsNz-mZfJzWaSwe-6YJ1ZA5gGk'
})(MapContainer);
